import React from 'react';
import {Link} from "react-router-dom";
import { alpha,
         AppBar, 
         CssBaseline,
         InputBase,
         makeStyles,   
         Toolbar,
         Typography } from '@material-ui/core';
import SearchIcon from '@material-ui/icons/Search'
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    justify: 'space-between',
  },
  appBar:{
    borderBlockColor:"#ffa500",
    color: "#ffa500",
    position: "static"
  },
  barItems:{
    paddingLeft: 13,
    color: 'inherit',
    textDecoration: 'inherit'
  }, 
  title: {
    marginRight: theme.spacing(2)
  },
  search:{
    position: 'relative',
    marginLet: 0,
    borderRadius: theme.shape.borderRadius,
    backgroundColor: alpha(theme.palette.common.white, 0.15),
    '&:hover': {
      backgroundColor: alpha(theme.palette.common.white, 0.25),
    },
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      marginLeft: theme.spacing(1),
      width: 'auto',
    },
  },
  searchIcon: {
    padding: theme.spacing(0, 2),
    height: '100%',
    position: 'absolute',
    pointerEvents: 'none',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
   inputRoot: {
    color: 'inherit',
  },
  inputInput: {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)}px)`,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      width: '12ch',
      '&:focus': {
        width: '20ch',
      },
    },
  }
}));

export default function Header() {
    //#e05929;
    const classes = useStyles();
    return(
        <div className={classes.root}>
            <CssBaseline/>
            <AppBar className={classes.appBar}>
                <Toolbar>
                    <Typography variant="h5" noWrap className={classes.title}>
                        HCA Healthcare Video Library
                    </Typography>
                    <Link to="/" className={classes.barItems}>
                      <Typography variant="h6" textAlign="center">Covid Videos</Typography>
                    </Link>
                    <Link to="/:otherVideos" className={classes.barItems} style={{flex: 1}}>
                      <Typography variant="h6" textAlign="center" >Other Videos</Typography>
                    </Link>
                    <div className={classes.search}>
                      <div className={classes.searchIcon}>
                        <SearchIcon />
                      </div>

                      <InputBase placeholder='Search...' 
                                 classes={{
                                    root: classes.inputRoot,
                                    input: classes.inputInput,
                                 }}
                                 inputProps={{'aria-label': 'search'}} />
                    </div>
                </Toolbar>
            </AppBar>
        </div> 
    );
}
